commitMessage:
rpm/macros.tizen-platform: replace known paths by rpm macros

This is needed for Yocto builds:

* /usr/share/man => %{_mandir}
* /usr/share/info => %{_infodir}
* /usr/share => %{_datadir}
* /usr/bin => %{_bindir}
* /usr/sbin => %{_sbindir}
* /usr/include => %{_includedir}
* /usr/lib => %{_libdir}
* /usr => %{_prefix}
* /etc => %{_sysconfdir}
* /var => %{_var}

